'''Dagannoth Prime''' is the [[Magic]]-based [[Dagannoth King]] found in the depths of the [[Waterbirth Island Dungeon]], along with fellow Dagannoth Kings, [[Dagannoth Rex]] and [[Dagannoth Supreme]]. Prime is the only monster to drop the [[Seers ring]] and [[Mud battlestaff]]. His projectile resembles [[Water Wave]]. He, along with the other Dagannoth Kings, can also drop the [[dragon axe]].

